cy.fixture("registry/routes.admin.json").then(function (cfg) {
    cy.loginAs(role);
    // For smoke test, we only check a representative subset of routes per role
    // to keep the suite fast. Full matrix is in 10_security.
    var smokeRoutes = role === "guest"
        ? cfg.routes.filter(function (r) { return r.auth === "guest"; })
        : cfg.routes.filter(function (r) { return ["staff", "any"].includes(r.auth); });
    smokeRoutes.forEach(function (r) {
        cy.log("[".concat(role, "] Testing Route: ").concat(r.key, " -> ").concat(r.path));
        cy.visitAppRoute(cfg.baseUrlEnv, r.path);
        cy.get("body").should("be.visible");
        cy.get("body").should("not.contain", "404");
        if (role !== "guest") {
            cy.getByCy("sidebar").should("be.visible");
        }
    });
});

